local ref = gui.Reference("Visuals", "Local")
local killmarks_groupbox = gui.Groupbox(ref, "KillMarks", 328,188, 296,400)
local killmark_checkbox = gui.Checkbox(killmarks_groupbox, "killmark.enable", "Enable KillMarks", false );
local killmark_size_slider = gui.Slider(killmarks_groupbox, "killmark.size", "Size", 100, 50, 300 )
local killmark_x_slider = gui.Slider(killmarks_groupbox, "killmark.x", "Horizontal Position", 0.5, 0, 1, 0.05 )
local killmark_y_slider = gui.Slider(killmarks_groupbox, "killmark.y", "Vertical Position", 0.2, 0, 1, 0.05 )
local killmark_time_slider = gui.Slider(killmarks_groupbox, "killmark.time", "Duration", 2, 0, 10, 0.1 )
local killsound_checkbox = gui.Checkbox(killmarks_groupbox, "killsound.enable", "Enable KillSounds", false );
local KillCount = 0
local HSCount = 0
local Image = 0
local seconds = 0.0
local b64_1 = [[]]
local b64_2 = [[]]
local b64_3 = [[]]
local b64_4 = [[]]
local b64_5 = [[]]
local b64_hs1 = [[]]
local b64_hs2 = [[]]
local b='ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/'
local function dec(data)
    data = string.gsub(data, '[^'..b..'=]', '')
    return (data:gsub('.', function(x)
        if (x == '=') then return '' end
        local r,f='',(b:find(x)-1)
        for i=6,1,-1 do r=r..(f%2^i-f%2^(i-1)>0 and '1' or '0') end
        return r;
    end):gsub('%d%d%d?%d?%d?%d?%d?%d?', function(x)
        if (#x ~= 8) then return '' end
        local c=0
        for i=1,8 do c=c+(x:sub(i,i)=='1' and 2^(8-i) or 0) end
        return string.char(c)
    end))
end

local dat_1 = dec(b64_1)
local rgba_1, w_1, h_1 = common.DecodePNG(dat_1)
local kill_1 = draw.CreateTexture(rgba_1, w_1, h_1)

local dat_2 = dec(b64_2)
local rgba_2, w_2, h_2 = common.DecodePNG(dat_2)
local kill_2 = draw.CreateTexture(rgba_2, w_2, h_2)

local dat_3 = dec(b64_3)
local rgba_3, w_3, h_3 = common.DecodePNG(dat_3)
local kill_3 = draw.CreateTexture(rgba_3, w_3, h_3)

local dat_4 = dec(b64_4)
local rgba_4, w_4, h_4 = common.DecodePNG(dat_4)
local kill_4 = draw.CreateTexture(rgba_4, w_4, h_4)

local dat_5 = dec(b64_5)
local rgba_5, w_5, h_5 = common.DecodePNG(dat_5)
local kill_5 = draw.CreateTexture(rgba_5, w_5, h_5)

local dat_hs1 = dec(b64_hs1)
local rgba_hs1, w_hs1, h_hs1 = common.DecodePNG(dat_hs1)
local hs_1 = draw.CreateTexture(rgba_hs1, w_hs1, h_hs1)

local dat_hs2 = dec(b64_hs2)
local rgba_hs2, w_hs2, h_hs2 = common.DecodePNG(dat_hs2)
local hs_2 = draw.CreateTexture(rgba_hs2, w_hs2, h_hs2)

local function RoundReset( event )
   if event:GetName() == "round_prestart" then
       KillCount = 0
	   HSCount = 0
   end
end

function KillMark()
	if killmark_checkbox:GetValue() == false then
		return
	end
	if Image == 0 then
		return
	end
	if seconds < globals.CurTime() then
		Image = 0
		return
	end
	if Image == 1 then
		draw.SetTexture( kill_1 );
	elseif Image == 2 then
		draw.SetTexture( kill_2 );
	elseif Image == 3 then
		draw.SetTexture( kill_3 );
	elseif Image == 4 then
		draw.SetTexture( kill_4 );
	elseif Image == 5 then
		draw.SetTexture( kill_5 );
	elseif Image == 6 then
		draw.SetTexture( hs_1 );
	elseif Image == 7 then
		draw.SetTexture( hs_2 );
	end
	local screenX, screenY = draw.GetScreenSize();
	draw.FilledRect((screenX * killmark_x_slider:GetValue()) - killmark_size_slider:GetValue(), (screenY * (1 - killmark_y_slider:GetValue())) - killmark_size_slider:GetValue(), (screenX * killmark_x_slider:GetValue()) + killmark_size_slider:GetValue(), (screenY * (1 - killmark_y_slider:GetValue())) + killmark_size_slider:GetValue())
end

local function KillSound( Event )
   if ( Event:GetName() == 'player_death' ) then
       local ME = client.GetLocalPlayerIndex();
       local INT_UID = Event:GetInt( 'userid' );
       local INT_ATTACKER = Event:GetInt( 'attacker' );
       local INDEX_Victim = client.GetPlayerIndexByUserID( INT_UID );
       local INDEX_Attacker = client.GetPlayerIndexByUserID( INT_ATTACKER );
       if ( INDEX_Attacker == ME and INDEX_Victim ~= ME ) then
			seconds = globals.CurTime() + killmark_time_slider:GetValue()
			KillCount = KillCount + 1
			if ( Event:GetInt("headshot") == 1 ) then
				HSCount = HSCount + 1
			end
			if ( Event:GetInt("headshot") == 1 ) and HSCount == 1 then
				Image = 6
			elseif ( Event:GetInt("headshot") == 1 ) and HSCount == 2 then
				Image = 7
			elseif KillCount == 1 then
				Image = 1
			elseif KillCount == 2 then
				Image = 2
			elseif KillCount == 3 then
				Image = 3
			elseif KillCount == 4 then
				Image = 4
			elseif KillCount == 5 then
				Image = 5
			elseif (KillCount > 5) and ( Event:GetInt("headshot") == 1 ) then
				Image = 6
			elseif KillCount > 5 then
				Image = 1
			end
			if (killsound_checkbox:GetValue() == false) then
				if (KillCount > 5) and ( Event:GetInt("headshot") == 1 ) then
					KillCount = 1
					HSCount = 1
				elseif (KillCount > 5) then
					KillCount = 1
					HSCount = 0
				end
				return
			end
			if ( Event:GetInt("penetrated") == 1 ) then
				if ( Event:GetInt("headshot") == 1 ) then
					if KillCount == 1 then
						client.Command("playvol killsound/dominating 1", true)				
					elseif KillCount == 2 then
						client.Command("playvol killsound/wickedsick 1", true)
					elseif KillCount == 3 then
						client.Command("playvol killsound/unstoppable 1", true)
					elseif KillCount == 4 then
						client.Command("playvol killsound/combowhore 1", true)
					elseif KillCount == 5 then
						client.Command("playvol killsound/ludicrouskill 1", true)
					else
						KillCount = 1
						HSCount = 1
						client.Command("playvol killsound/dominating 1", true)
					end
				else
					if KillCount == 1 then
						client.Command("playvol killsound/impressive 1", true)				
					elseif KillCount == 2 then
						client.Command("playvol killsound/perfect 1", true)
					elseif KillCount == 3 then
						client.Command("playvol killsound/godlike 1", true)
					elseif KillCount == 4 then
						client.Command("playvol killsound/rampage 1", true)
					elseif KillCount == 5 then
						client.Command("playvol killsound/holyshit 1", true)
					else
						KillCount = 1
						HSCount = 0
						client.Command("playvol killsound/impressive 1", true)
					end
				end
			else
				if ( Event:GetInt("headshot") == 1 ) then
					if KillCount == 1 then
						client.Command("playvol killsound/headshot 1", true)				
					elseif KillCount == 2 then
						client.Command("playvol killsound/headshot 1", true)
					elseif KillCount == 3 then
						client.Command("playvol killsound/hattrick 1", true)
					elseif KillCount == 4 then
						client.Command("playvol killsound/headhunter 1", true)
					elseif KillCount == 5 then
						client.Command("playvol killsound/monsterkill 1", true)
					else
						KillCount = 1
						HSCount = 1
						client.Command("playvol killsound/headshot 1", true)
					end
				else			
					if KillCount == 2 then
						client.Command("playvol killsound/doublekill 1", true)
					elseif KillCount == 3 then
						if math.random(0, 1) then
							client.Command("playvol killsound/triplekill 1", true)
						else
							client.Command("playvol killsound/multikill 1", true)
						end
					elseif KillCount == 4 then
						client.Command("playvol killsound/ultrakill 1", true)
					elseif KillCount == 5 then
						client.Command("playvol killsound/killingspree 1", true)
					else
						KillCount = 1
						HSCount = 0
					end
				end
			end	
	   end
   end
end

client.AllowListener( 'player_death' );
client.AllowListener( "round_prestart" );

callbacks.Register( "FireGameEvent", "RoundReset", RoundReset);
callbacks.Register('Draw', 'KillMark', KillMark);
callbacks.Register( 'FireGameEvent', 'KillSound', KillSound );
